import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { ImageComparison } from './ImageComparison';

function Examples() {

	const ImageBefore1 = '../img/before-after/before1.jpg'; 
	const ImageAfter1 = '../img/before-after/after1.jpg';
	const ImageBefore2 = '../img/before-after/before2.jpg';
	const ImageAfter2 =  '../img/before-after/after2.jpg';
	const ImageBefore3 = '../img/before-after/before3.jpg';
	const ImageAfter3 = '../img/before-after/after3.jpg';

  return (
	<Container className="pt-5 mt-5">
		<Row>
			<Col>
				<h1 className = "display-5 fw-bold text-center">Cleaning Examples</h1>
				<p className = "text-center">Slide on the image to view before and after photos of our work.</p>		
			</Col>
		</Row>
		<Row>
			<Col>
				<ImageComparison beforeImage={ImageBefore1} ImageAfter1/>
			</Col>
			<Col>
				<ImageComparison />
			</Col>
			<Col>
				<ImageComparison />
			</Col>
			<p>{ImageBefore1}</p>
			<img src={ImageBefore1}/>
			<img src="/img/beforeafter/before1.jpg" />
		</Row>
	</Container>
  );
}

export default Examples;
